import React from "react";
import { Link } from "react-router-dom";
import { Col, Row, Button, Container } from "reactstrap";
import "./Thankyou.css";
import Newsletter from "../components/Shared/Newsletter";
import Booking from "../components/Booking/Booking";
import './Mybooking.css'

const Mybooking = (props) => {
  const { booking } = props;

  return (
    <>
      <section>
        <Container>
          <Row>
            <Col lg="12" className="pt-5 text-center">
              <div className="thank__you">
                
                <h1 className=".mb-3 fw-semibold">Thank You</h1>
                <h3 className="mb-4">Your Travel is Booked </h3>
                <Button className="btn primary__btn w-25">
                  <Link to="/home">Back To Home</Link>
                </Button>

                <h2>Other Page</h2>
                {/* Display the booking data */}
                <p>User ID:{booking?.booking.userId}</p>
                <p>User Email: {booking?.userEmail}</p>
                <p>Tour Name: {booking?.tourName}</p>
                {/* Other booking details */}
              </div>
            </Col>
          </Row>
        </Container>
        <div className="Newsletter">
          <Newsletter />
        </div>
      </section>

       <div>
      <div className="cardBook" style={{ width: "18rem", margin: "0px 0px 45px" }}>
        
         <img srcSet="https://wallpaperaccess.com/full/41839.jpg" alt="" />
        <div className="card-body">
          <h5 className="card-title">City </h5>
          <p className="card-text">Description</p>
          <p className="card-text">
            <small className="text-muted">
              {" "} By user  on{" "} {new Date().toGMTString()}{" "}
            </small>
          </p>
          <a href="https://wallpaperaccess.com/full/41839.jpg" target="_blank" className="btn btm-sm btn-dark">
            Know More
          </a>
        </div>
      </div>
    </div>
    </>
  );
};

export default Mybooking;
